import React, { useRouteMatch } from "react";
import { Switch, Route } from "react-router";

function SourcesPage() {
   let { path, url } = useRouteMatch();
   return (
      <Switch>
         <Route exact path={`${path}/cnn`}></Route>
         <Route exact path={`${path}/time`}></Route>
         <Route exact path={`${path}/reuters`}></Route>
         <Route exact path={`${path}/bbc-news`}></Route>
         <Route exact path={`${path}/espn`}></Route>
      </Switch>
   );
}

export default SourcesPage;
